var hubUrl="https://localhost:44316/chat";const hubConnection=(new signalR.HubConnectionBuilder).withUrl(hubUrl).configureLogging(signalR.LogLevel.Information).build();hubConnection.on("Send",function(n){let t=`<div>${n.date} -  ${n.name}</div>    ${n.comment}
    <input type="button" id="like" onclick="ProcessLike('${n.Id}')" value="like!" />
    <div>${n.likes}</div>`;$("#"+n.articleId).prepend("<li > "+t+" <\/li>")});hubConnection.start();